import mainBox from "./main"
import tabs from "./tabs"
import { mapState } from 'vuex'
import getPageTitle from '@/utils/getPageName'
export default {
    name: "tenantEqu",
    components: { mainBox, tabs },
    computed: {
        ...mapState({
            pages: state => state.goPage.pages,
        })
    },
    data () {
        return {
            title: getPageTitle(this.$route.name)
        }
    },
    methods: {},
    destroyed () {
        this.$store.dispatch('goPage/getCode', undefined)
        this.$store.dispatch('goPage/goPages', 'main')
    },
    deactivated () {
        this.$store.dispatch('goPage/getCode', undefined)
        this.$store.dispatch('goPage/goPages', 'main')
    }
};
